import React from "react";

export default function Search() {
  return (
    <form className="form">
      <h1>Search</h1>
      <label className="label" htmlFor="query">
        Movie Title
      </label>
      <input
        type="text"
        className="input"
        name="query"
        placeholder="Search for a movie"
      ></input>
      <button class="button" type="submit">
        Search
      </button>
    </form>
  );
}
